import React from 'react';
import { ITabProps } from '../types/types';

const Tab = (props: ITabProps): JSX.Element => {

    const {
        href, 
        faIcon, 
        isActive
    } = props

    return (
        <>
            <li className={isActive ? 'active' : ''}>
                <a href={href} role="tab">
                    <i
                        className={faIcon}>
                    </i>
                </a>
            </li>
        </>
    )
}

export default Tab;
